import React from "react";
import DisplayParts from "../components/DisplayParts";

const CreateComputer = () => {

    const part = [
        {
            "name": "Montech X3 Mesh 6pcs, 3 x 140mm& 3 x 120mm Fixed RGB Lighting Fans ATX Mid-Tower PC Gaming Case",
            "description": "a desktop case that is from Montech",
            "price": 152.61,
            "category": "case",
            "id": 1234
        },
        {
            "name": "LIAN LI PC-O11 Dynamic White Tempered Glass on the Front and Left Sides, Chassis Body SECC ATX Mid Tower Gaming Computer Case",
            "description": "a desktop case that is from Lian",
            "price": 242.97,
            "category": "case",
            "id": 4321
        }
    ]
    const theCategory = ['case','motherboard','CPU','GPU','RAM','storage_device','cooling','power_supply_unit','monitor','OS','keyboard','mouse']

    return (
        <main className="container-2">
            <DisplayParts
            parts={part}
            category={theCategory}></DisplayParts>
        </main>
    )
}

export default CreateComputer
